<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Soppiya theme</title>

    <link
        href="https://fonts.googleapis.com/css2?family=Montserrat:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;1,100;1,200;1,300;1,400;1,500;1,600;1,700&display=swap"
        rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: "Montserrat", sans-serif;
        }

        body {
            background-color: #F1F5FF;
        }

        ul {
            list-style: none;
            padding: 0;
            margin: 0;
        }

        a {
            text-decoration: none;
        }

        .container {
            max-width: 1550px;
            width: 100%;
            padding: 0 20px;
            margin: 0 auto;
        }

        .cartHeaderInner {
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;
            align-items: center;
        }

        .cartIconArea {
            width: 15px;
        }

        .cartHeadingTextArea {
            width: calc(100% - 15px);
            text-align: center;
        }

        .cartHeader {
            background-color: #fff;
            height: 60px;
            display: flex;
            align-items: center;
            position: fixed;
            width: 100%;
            left: 0;
        }

        .cartHeadingText {
            font-weight: 700;
            font-size: 18px;
            color: #01126C;
            display: inline-block;
        }

        .addProductInWistlist {
            background-color: #fff;
            padding-top: 60px
        }

        .addProductInWistlistInner {
            background-color: #F1F5FF;
            border-top-left-radius: 20px;
            border-top-right-radius: 20px;
        }

        .addProudctArea {
            padding: 25px 0px;
        }

        div#cartProductItemWrapper,
        .couponCodeArea,
        .cartTotalsArea {
            background: #fff;
            border-radius: 5px;
            padding: 20px;
        }

        .cartProductItem {
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;
            /* padding: 13px 16px; */
        }

        .cartProductItem:not(:last-child) {
            margin-bottom: 15px;
            border-bottom: 1px solid rgb(149 175 192 / 10%);
            padding-bottom: 15px;
        }

        .cartProductImgArea .cardItemImg {
            width: 100%;
            cursor: pointer;
        }

        .cartProductImgArea {
            width: 90px;
            display: flex;
            align-items: center;
            border: 2px solid #F1F5FF;
            border-radius: 5px;
            overflow: hidden;
        }

        .deleteIconArea {
            width: 15px;
        }

        .deleteIconArea svg {
            cursor: pointer;
        }

        .cartProductContent {
            width: calc(100% - 120px);
            margin-left: 15px;
        }

        .productHeadingText {
            font-size: 13px;
            font-weight: 600;
            color: #2C2C2C;
            line-height: 16px;
            cursor: pointer;
        }

        .productPricingText {
            font-size: 11px;
            font-weight: 500;
            color: #778994;
            margin-top: 8px;
        }


        .quntityArea {
            width: 70px;
            height: 22px;
            border: 1px solid #95AFC0;
            border-radius: 3px;
            justify-content: space-between;
            display: flex;
            padding: 0 8px;
            margin-top: 10px;
            align-items: center;
        }

        .incrementBtn,
        .decrementBtn {
            border: none;
            outline: none;
            background: transparent;
            display: flex;
            align-items: center;
        }

        .incrementBtn svg tspan,
        .decrementBtn svg tspan {
            font-size: 16px;
            font-weight: 700;
            color: #778994;
        }

        .qtyNumber {
            font-weight: 700;
            font-size: 12px;
            color: #2C2C2C;
            height: 22px;
            display: flex;
            align-items: center;
        }


        /* coupon code area */
        .couponCodeArea,
        .cartTotalsArea {
            margin-top: 20px;
        }

        .couponCodeHeading {
            margin-bottom: 15px;
        }

        .couponCodeHeadingText,
        .cartTotalHeadingText {
            font-size: 16px;
            font-weight: 700;
            color: #01126C;
            margin-bottom: 20px;
        }

        .couponCodeForOfferInner {
            position: relative;
            width: 100%;
        }

        .labelText {
            display: inline-block;
            background: #fff;
            padding: 0px 5px;
            font-size: 12px;
            font-weight: 500;
            color: #3E5570;
            position: absolute;
            left: 6px;
            top: -15px;
        }

        .inputFieldControl {
            height: 36px;
            padding: 0 10px;
            border-radius: 5px;
            border: 1px solid rgba(149 175 192 / 40%);
            width: 100%;
            outline: none;
            background-color: transparent;
            font-size: 12px;
            font-weight: 500;
            color: #3E5570;
        }

        .applyCouponBtn {
            background-color: #00A5FF;
            border-radius: 3px;
            font-size: 12px;
            font-weight: 500;
            border: none;
            color: #fff;
            width: 117px;
            height: 30px;
            display: flex;
            justify-content: center;
            align-items: center;
            margin-top: 15px;
            outline: none;
            cursor: pointer;
        }

        /* cart total */
        .subTotalArea {
            display: flex;
            justify-content: space-between;
        }

        .subTotalArea:not(:last-child) {
            border-bottom: 1px solid rgb(149 175 192 / 10%);
            margin-bottom: 10px;
            padding-bottom: 10px;
        }

        .subTotalLeftText,
        .subTotalRightText {
            font-size: 12px;
            font-weight: 500;
            color: #3E5570;
        }

        .subTotalRightText,
        .totalBoldText {
            font-weight: 600;
        }

        .moveOtherPageFormCartPage {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-top: 20px;
            flex-wrap: wrap;
        }

        .moveToShoppingBtn {
            display: flex;
            justify-content: space-between;
            align-items: center;
            border: none;
            background: transparent;
            margin-bottom: 10px;
            outline: none;
            cursor: pointer;

        }

        .continueShippingText {
            font-size: 12px;
            font-weight: 600;
            color: #3E5570;
            margin-left: 10px;
        }

        .moveToToCheckOutBtn {
            width: 150px;
            height: 30px;
            font-size: 12px;
            font-weight: 500;
            background: #00A5FF;
            border: none;
            color: #fff;
            border-radius: 3px;
            outline: none;
            cursor: pointer;

        }

        @media(min-width:768px) {

            .container {
                padding: 0 30px;
            }

            .cartHeader {
                display: none;
            }

            .addProductInWistlist {
                padding-top: 0px;
                background-color: unset;
            }

            .addProductInWistlistInner {
                background-color: unset;
                border-top-left-radius: 0px;
                border-top-right-radius: 0px;
            }

            .addProudctArea {
                display: flex;
                flex-wrap: wrap;
                width: 100%;
                justify-content: space-between;
            }

            .cartProductItemWrapper {
                width: calc(65% - 30px);
            }

            .couponCodeAndCartTotal {
                display: flex;
                flex-direction: column;
                width: 35%;
            }

            .couponCodeArea {
                margin-top: 0px;
            }

            .moveOtherPageFormCartPage {
                width: 100%;
            }

            .cartTotalsArea {
                margin-top: 30px;
            }

            .productHeadingText {
                font-size: 14px;
                line-height: 24px;
                width: 272px;

            }

            .productPricingText {
                font-size: 14px;
            }

            .quntityArea {
                width: 100px;
                height: 36px;

            }

            .cartProductItem {
                align-items: center;
            }


            .incrementBtn svg tspan,
            .decrementBtn svg tspan {
                font-size: 24px;
                font-weight: 400;
            }

            .incrementBtn svg,
            .decrementBtn svg {
                width: 20px;
                margin-top: 5px;
            }

            .cartProductImgArea {
                width: 100px;
                height: 100px;
            }

            .cartProductContent {
                width: calc(100% - 130px);
                margin-left: 15px;
            }

            .couponCodeHeadingText,
            .cartTotalHeadingText {
                font-size: 18px;
            }

            .labelText {
                font-size: 13px;
            }

            .applyCouponBtn {
                font-size: 14px;
                width: 130px;
                height: 30px;
            }

            .subTotalLeftText,
            .subTotalRightText {
                font-size: 14px;
            }

            .continueShippingText {
                font-size: 14px;
            }

            .moveToToCheckOutBtn {
                width: 183px;
                height: 36px;
                font-size: 14px;
            }

        }

        @media(min-width:1025px) {
            .cartProductItemWrapper {
                width: calc(68% - 50px);
            }

            .couponCodeAndCartTotal {
                display: flex;
                flex-direction: column;
                width: 32%;
            }

            .cartProductItem {
                flex-wrap: nowrap;
            }

            .cartProductContent {
                display: grid;
                grid-template-columns: auto auto auto;
                column-gap: 10px;
                align-items: center;
                width: calc(100% - 130px);
                margin-left: 25px;
            }

            div#cartProductItemWrapper,
            .couponCodeArea,
            .cartTotalsArea {
                padding: 30px;
            }
        }
    </style>
</head>

<body>
    <!-- start  cart header -->
    <div class="cartHeader">
        <div class="container">
            <div class="cartHeaderInner" id="cartHeaderInner">

            </div>
        </div>
    </div>
    <!-- end  cart header -->

    <!-- start add cart product -->
    <div class="addProductInWistlist">
        <div class="addProductInWistlistInner">
            <div class="container">
                <div class="addProudctArea">
                    <!-- product -->
                    <div class="cartProductItemWrapper" id="cartProductItemWrapper">

                    </div>

                    <div class="couponCodeAndCartTotal">
                        <!-- coupon code -->
                        <div class="couponCodeArea">
                            <div class="couponCodeHeading">
                                <p class="couponCodeHeadingText">Have any coupon?</p>
                            </div>

                            <div class="couponCodeForOffer">
                                <label for="" class="couponCodeForOfferInner">
                                    <span class="labelText">Coupon Code</span>
                                    <input type="email" class="inputFieldControl" autocomplete="off">
                                </label>

                                <button class="applyCouponBtn">Apply Coupon</button>
                            </div>
                        </div>

                        <!-- cart totals -->
                        <div class="cartTotalsArea">
                            <!-- heading -->
                            <div class="cartTotalsHeading">
                                <p class="cartTotalHeadingText">Cart Totals</p>
                            </div>
                            <div class="cartTotalsBody">
                                <!-- subtotal -->
                                <div class="subTotalArea">
                                    <div class="subTotalLeft">
                                        <p class="subTotalLeftText">Subtotal</p>
                                    </div>
                                    <div class="subTotalRight">
                                        <p class="subTotalRightText">৳ 156000</p>
                                    </div>
                                </div>
                                <!-- Shipping -->
                                <div class="subTotalArea">
                                    <div class="subTotalLeft">
                                        <p class="subTotalLeftText">Shipping</p>
                                    </div>
                                    <div class="subTotalRight">
                                        <p class="subTotalRightText">Calculated at next step</p>
                                    </div>
                                </div>
                                <!-- Coupon -->
                                <div class="subTotalArea">
                                    <div class="subTotalLeft">
                                        <p class="subTotalLeftText">Coupon</p>
                                    </div>
                                    <div class="subTotalRight">
                                        <p class="subTotalRightText">- ৳ 2000</p>
                                    </div>
                                </div>
                                <!-- Total -->
                                <div class="subTotalArea">
                                    <div class="subTotalLeft">
                                        <p class="subTotalLeftText totalBoldText">Total</p>
                                    </div>
                                    <div class="subTotalRight">
                                        <p class="subTotalRightText">৳ 154000</p>
                                    </div>
                                </div>

                            </div>

                        </div>
                         <!-- move other page  from cart page -->
                    <div class="moveOtherPageFormCartPage">
                        <div class="moveToShopping">
                            <button class="moveToShoppingBtn">
                                <svg xmlns="http://www.w3.org/2000/svg" width="5.122" height="10"
                                    viewBox="0 0 5.122 10">
                                    <path id="fi-rr-angle-small-left"
                                        d="M9.946,10.505a.714.714,0,0,1,0-1.01l3.275-3.276a.714.714,0,1,0-1.01-1.01L8.938,8.485a2.143,2.143,0,0,0,0,3.03l3.276,3.276a.714.714,0,1,0,1.01-1.01Z"
                                        transform="translate(-8.311 -5)" fill="#3e5570" />
                                </svg>
                                <p class="continueShippingText">Continue Shopping</p>
                            </button>
                        </div>
                        <div class="moveToProcessCheckout">
                            <button class="moveToToCheckOutBtn">Process to checkout</button>
                        </div>
                    </div>
                    </div>
                   
                </div>
            </div>
        </div>
    </div>
    <!-- start end cart product -->
